import React, { useState, useEffect } from 'react';
import { useCart } from '../../context/CartContext';
import { productAPI } from '../../services/api';
import './ProductPages.css';

const ZodiacCoins = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const { addToCart } = useCart();

  // Fallback data if API fails
  const fallbackCoins = [
    { id: 301, name: 'Aries Zodiac Coin', symbol: '‚ôà', description: 'Collectible coin featuring Aries zodiac sign (Mar 21 - Apr 19)', price: 199, type: 'zodiac_coin', stock: 15 },
    { id: 302, name: 'Taurus Zodiac Coin', symbol: '‚ôâ', description: 'Collectible coin featuring Taurus zodiac sign (Apr 20 - May 20)', price: 199, type: 'zodiac_coin', stock: 12 },
    { id: 303, name: 'Gemini Zodiac Coin', symbol: '‚ôä', description: 'Collectible coin featuring Gemini zodiac sign (May 21 - Jun 20)', price: 199, type: 'zodiac_coin', stock: 20 },
    { id: 304, name: 'Cancer Zodiac Coin', symbol: '‚ôã', description: 'Collectible coin featuring Cancer zodiac sign (Jun 21 - Jul 22)', price: 199, type: 'zodiac_coin', stock: 8 },
    { id: 305, name: 'Leo Zodiac Coin', symbol: '‚ôå', description: 'Collectible coin featuring Leo zodiac sign (Jul 23 - Aug 22)', price: 199, type: 'zodiac_coin', stock: 14 },
    { id: 306, name: 'Virgo Zodiac Coin', symbol: '‚ôç', description: 'Collectible coin featuring Virgo zodiac sign (Aug 23 - Sep 22)', price: 199, type: 'zodiac_coin', stock: 11 },
    { id: 307, name: 'Libra Zodiac Coin', symbol: '‚ôé', description: 'Collectible coin featuring Libra zodiac sign (Sep 23 - Oct 22)', price: 199, type: 'zodiac_coin', stock: 9 },
    { id: 308, name: 'Scorpio Zodiac Coin', symbol: '‚ôè', description: 'Collectible coin featuring Scorpio zodiac sign (Oct 23 - Nov 21)', price: 199, type: 'zodiac_coin', stock: 16 },
    { id: 309, name: 'Sagittarius Zodiac Coin', symbol: '‚ôê', description: 'Collectible coin featuring Sagittarius zodiac sign (Nov 22 - Dec 21)', price: 199, type: 'zodiac_coin', stock: 7 },
    { id: 310, name: 'Capricorn Zodiac Coin', symbol: '‚ôë', description: 'Collectible coin featuring Capricorn zodiac sign (Dec 22 - Jan 19)', price: 199, type: 'zodiac_coin', stock: 13 },
    { id: 311, name: 'Aquarius Zodiac Coin', symbol: '‚ôí', description: 'Collectible coin featuring Aquarius zodiac sign (Jan 20 - Feb 18)', price: 199, type: 'zodiac_coin', stock: 18 },
    { id: 312, name: 'Pisces Zodiac Coin', symbol: '‚ôì', description: 'Collectible coin featuring Pisces zodiac sign (Feb 19 - Mar 20)', price: 199, type: 'zodiac_coin', stock: 10 }
  ];

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const response = await productAPI.getByType('zodiac_coin');
      setProducts(response.products || []);
    } catch (error) {
      console.error('Error fetching zodiac coins:', error);
      // Use fallback data if API fails
      setProducts(fallbackCoins);
    } finally {
      setLoading(false);
    }
  };

  const handleAddToCart = (product) => {
    addToCart(product, 1);
  };

  if (loading) {
    return (
      <div className="product-page">
        <div className="container">
          <div className="loading-spinner">Loading zodiac coins...</div>
        </div>
      </div>
    );
  }

  return (
    <div className="product-page">
      <div className="container">
        <div className="page-header">
          <h1 className="page-title">Zodiac Coins</h1>
          <p className="page-subtitle">
            Collectible coins featuring all zodiac signs with special stamps, perfect for astrology enthusiasts
          </p>
        </div>

        <div className="products-grid">
          {products.map((product) => (
            <div key={product.id} className="product-card">
              <div className="product-image">
                <div className="coin-display">
                  <div className="zodiac-symbol">{product.symbol}</div>
                  <div className="zodiac-name">{product.name.split(' ')[0]}</div>
                </div>
              </div>

              <div className="product-info">
                <h3 className="product-name">{product.name}</h3>
                <p className="product-description">{product.description}</p>
                <div className="product-price">‚Çπ{product.price}</div>

                {product.stock > 0 ? (
                  <button 
                    onClick={() => handleAddToCart(product)}
                    className="btn btn-primary add-to-cart-btn"
                  >
                    Add to Cart
                  </button>
                ) : (
                  <button 
                    className="btn btn-secondary add-to-cart-btn" 
                    disabled
                  >
                    Out of Stock
                  </button>
                )}
              </div>
            </div>
          ))}
        </div>

        <div className="product-info-section">
          <h2>About Our Zodiac Coins</h2>
          <div className="info-grid">
            <div className="info-item">
              <h3>‚≠ê All 12 Signs</h3>
              <p>Complete collection of all zodiac signs with authentic symbols and dates.</p>
            </div>
            <div className="info-item">
              <h3>ü™ô Premium Quality</h3>
              <p>High-quality coins with detailed engravings and special stamps.</p>
            </div>
            <div className="info-item">
              <h3>üéÅ Perfect Gifts</h3>
              <p>Ideal gifts for astrology lovers and those who believe in zodiac signs.</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ZodiacCoins;
